<html lang="ar" dir="rtl">
<head>

    <title>دليل الأعمال اللبناني</title>
    <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0/dist/css/bootstrap.min.css" rel="stylesheet">
    <style>

        .container { margin-top: 50px; max-width: 1000px; }
        .card { border-radius: 15px; box-shadow: 0 4px 15px rgba(0,0,0,0.1); }
        .header { background: linear-gradient(135deg, #007bff, #6610f2); color: white; padding: 30px; border-radius: 15px 15px 0 0; text-align: center; }
        .category-select { margin: 20px 0; }
        .data-table { margin-top: 20px; max-height: 500px; overflow-y: auto; }

        .stats { font-size: 0.9rem; color: #6c757d; margin-top: 10px; }
    </style>
</head>
<body>

<div class="container">
    <div class="card">
        <div class="header">
            <h1>دليل الأعمال اللبناني المنظم</h1>
            <p>استعرض البيانات وحملها كملفات CSV مباشرة</p>
        </div>
        <div class="card-body">
            <div class="row category-select">
                <div class="col-md-8">
                    <label for="categoryDropdown" class="form-label">اختر فئة العمل:</label>
                    <select id="categoryDropdown" class="form-select form-select-lg">

                    </select>
                </div>
                <div class="col-md-4 d-flex align-items-end">
                    <button id="downloadBtn" class="btn btn-download w-100" disabled>تحميل كـ CSV</button>
                </div>
            </div>

            <div id="stats" class="stats"></div>

            <div class="data-table">
                <table class="table table-hover">
                    <thead class="table-light">
                        <tr>
                            <th>الاسم</th>
                            <th>الرقم</th>
                            <th>العنوان / المنطقة</th>
                        </tr>
                    </thead>
                    <tbody id="dataTableBody">
                        <tr>
                            <td colspan="3" class="text-center text-muted">يرجى اختيار فئة لعرض البيانات</td>
                        </tr>
                    </tbody>
                </table>
            </div>
        </div>
    </div>
</div>

    const dropdown = document.getElementById('categoryDropdown');
    const tableBody = document.getElementById('dataTableBody');
    const downloadBtn = document.getElementById('downloadBtn');
    const statsDiv = document.getElementById('stats');

    // Populate dropdown
    const categories = Object.keys(businessData).sort();
    categories.forEach(cat => {
        const option = document.createElement('option');
        option.value = cat;
        option.textContent = cat;
        dropdown.appendChild(option);
    });

    dropdown.addEventListener('change', function() {
        const selectedCat = this.value;
        tableBody.innerHTML = '';
        
        if (selectedCat && businessData[selectedCat]) {
            const records = businessData[selectedCat];
            statsDiv.textContent = `عدد السجلات: ${records.length}`;
            downloadBtn.disabled = false;

            records.forEach(item => {
                const row = `<tr>
                    <td>${item.name}</td>
                    <td>${item.phone}</td>
                    <td>${item.address}</td>
                </tr>`;
                tableBody.innerHTML += row;
            });
        } else {
            tableBody.innerHTML = '<tr><td colspan="3" class="text-center text-muted">يرجى اختيار فئة لعرض البيانات</td></tr>';
            downloadBtn.disabled = true;
            statsDiv.textContent = '';
        }
    });

    downloadBtn.addEventListener('click', function() {
        const selectedCat = dropdown.value;
        if (!selectedCat) return;

        const records = businessData[selectedCat];
        let csvContent = "\uFEFFالاسم,الرقم,العنوان\n"; // BOM for Excel Arabic support
        
        records.forEach(item => {
            csvContent += `"${item.name}","${item.phone}","${item.address}"\n`;
        });

        const blob = new Blob([csvContent], { type: 'text/csv;charset=utf-8;' });
        const url = URL.createObjectURL(blob);
        const link = document.createElement("a");
        link.setAttribute("href", url);
        link.setAttribute("download", `${selectedCat}.csv`);
        document.body.appendChild(link);
        link.click();
        document.body.removeChild(link);
    });
</script>
